RegisterNetEvent("emotes")
AddEventHandler("emotes",function(name,sync)

    if LocalPlayer["state"]["Buttons"] then
        return
    end

	if not LocalPlayer["state"]["Commands"] and not LocalPlayer["state"]["Handcuff"] then
		local Ped = PlayerPedId()

		if Animations[name] and not IsPedArmed(Ped,6) and not IsPedSwimming(Ped) then
			if GetEntityHealth(Ped) > 100 and vINVENTORY.checkInventory() then
				vRP.DestroyObjects("one")

				if not IsPedInAnyVehicle(Ped) and not Animations[name]["cars"] then
					if Animations[name]["extra"] then
						Animations[name].extra()
					end
                    if sync then
                        if Animations[name]["target"]["pos1"] and not Animations[name]["target"]["anim"] then
                            vRP.CreateObjects("","",Animations[name]["target"]["prop"],Animations[name]["target"]["flag"],Animations[name]["target"]["hand"],Animations[name]["target"]["pos1"],Animations[name]["target"]["pos2"],Animations[name]["target"]["pos3"],Animations[name]["target"]["pos4"],Animations[name]["target"]["pos5"],Animations[name]["target"]["pos6"])
                        elseif Animations[name]["target"]["pos1"] and Animations[name]["target"]["anim"] then
                            vRP.CreateObjects(Animations[name]["target"]["dict"],Animations[name]["target"]["anim"],Animations[name]["target"]["prop"],Animations[name]["target"]["flag"],Animations[name]["target"]["hand"],Animations[name]["target"]["pos1"],Animations[name]["target"]["pos2"],Animations[name]["target"]["pos3"],Animations[name]["target"]["pos4"],Animations[name]["target"]["pos5"],Animations[name]["target"]["pos6"])
                        elseif Animations[name]["target"]["prop"] then
                            vRP.CreateObjects(Animations[name]["target"]["dict"],Animations[name]["target"]["anim"],Animations[name]["target"]["prop"],Animations[name]["target"]["flag"],Animations[name]["target"]["hand"])
                        elseif Animations[name]["target"]["dict"] then
                            vRP.playAnim(Animations[name]["target"]["walk"],{Animations[name]["target"]["dict"],Animations[name]["target"]["anim"]},Animations[name]["target"]["loop"])
                        else
                            vRP.playAnim(false,{ task = Animations[name]["target"]["anim"] },false)
                        end
                    else
                        if Animations[name]["pos1"] and not Animations[name]["anim"] then
                            vRP.CreateObjects("","",Animations[name]["prop"],Animations[name]["flag"],Animations[name]["hand"],Animations[name]["pos1"],Animations[name]["pos2"],Animations[name]["pos3"],Animations[name]["pos4"],Animations[name]["pos5"],Animations[name]["pos6"])
                        elseif Animations[name]["pos1"] and Animations[name]["anim"] then
                            vRP.CreateObjects(Animations[name]["dict"],Animations[name]["anim"],Animations[name]["prop"],Animations[name]["flag"],Animations[name]["hand"],Animations[name]["pos1"],Animations[name]["pos2"],Animations[name]["pos3"],Animations[name]["pos4"],Animations[name]["pos5"],Animations[name]["pos6"])
                        elseif Animations[name]["prop"] then
                            vRP.CreateObjects(Animations[name]["dict"],Animations[name]["anim"],Animations[name]["prop"],Animations[name]["flag"],Animations[name]["hand"])
                        elseif Animations[name]["dict"] then
                            vRP.playAnim(Animations[name]["walk"],{Animations[name]["dict"],Animations[name]["anim"]},Animations[name]["loop"])
                        else
                            vRP.playAnim(false,{ task = Animations[name]["anim"] },false)
                        end
                    end

                    if not sync then
                        if Animations[name]["target"] then
                            TriggerServerEvent("anim:sendRequest",name)
                        end
                    end
				else
					if IsPedInAnyVehicle(Ped) and Animations[name]["cars"] then
						local vehicle = GetVehiclePedIsUsing(Ped)

						if (GetPedInVehicleSeat(vehicle,-1) == Ped or GetPedInVehicleSeat(vehicle,1) == Ped) and name == "sexo4" then
							vRP.playAnim(Animations[name]["walk"],{Animations[name]["dict"],Animations[name]["anim"]},Animations[name]["loop"])
						elseif (GetPedInVehicleSeat(vehicle,0) == Ped or GetPedInVehicleSeat(vehicle,2) == Ped) and (name == "sexo5" or name == "sexo6") then
							vRP.playAnim(Animations[name]["walk"],{Animations[name]["dict"],Animations[name]["anim"]},Animations[name]["loop"])
						elseif name == "hotwired" then
							vRP.playAnim(Animations[name]["walk"],{Animations[name]["dict"],Animations[name]["anim"]},Animations[name]["loop"])
						end
					end
				end
			end
		end
	end
end)
